import React, { Component, Fragment } from 'react';
import { Helmet } from "react-helmet";

class Play extends Component {
    constructor (props) {
        super (props);
        this.state = {
            counter: 0
        };
    }

    increaseCount = () => {
        this.setState({
            counter: 5
        });
    };

    render() {
        return (
            <Fragment>
                <Helmet><title>Programming assignment - Quiz Page</title></Helmet>
                <div className="quastions">
                    <div className="lifeline-container">
                        <p>
                            <span className="mdi mdi-set-center mdi-24px lifeline-icon"></span>
                        </p>
                        <p>
                            <span className="mdi mdi-lightbulb mdi-24px lifeline-icon"></span>
                        </p>
                    </div>
                    <h5>Which of the following is not an organ in the human body?</h5>
                    <div className="option-container"> 
                        <p className="option">Pancreas</p>
                        <p className="option" >Ulna</p>
                    </div>
                    <div className="option-container"> 
                        <p className="option">Gallbladder</p>
                        <p className="option">Eye</p>
                    </div>
                    <div className="button-container">
                        <button>Previous</button>
                        <button>Next</button>
                        <button>Quit</button>
                    </div>
                </div>
            </Fragment>
        );
    }
}

export default Play;
